import React from "react";
import Faves from "../faves/faves";

function Card({
  title,
  date,
  address,
  link,
  image,
  description,
  event_location_map,
  id,
}) {
  return (
    // <main className="py-6 px-4 sm:p-6 md:py-10 md:px-8">
    //   <div className="max-w-4xl mx-auto grid grid-cols-1 lg:max-w-5xl lg:gap-x-20 lg:grid-cols-2 bg-white rounded-2xl">
