    // </main>
    <div class="flex flex-col justify-center h-screen">
      <div class="relative flex flex-col md:flex-row md:space-x-5 space-y-3 md:space-y-0 rounded-xl shadow-lg p-3 max-w-xs md:max-w-3xl mx-auto border border-white bg-white">
        <div class="w-full md:w-1/3 bg-white grid place-items-center object-cover">
          <img
            src={image}
            alt={title}
            className="w-full h-52 object-cover rounded-lg sm:h-full sm:col-span-2 lg:col-span-full"
          />
        </div>
        <div class="w-full md:w-2/3 bg-white flex flex-col space-y-2 p-3">
          <div className="flex justify-between">
            <h3 class="font-black text-gray-800 md:text-3xl text-xl mt-2">
              {title}
            </h3>
            <Faves
              id={id}
              title={title}
              date={date}
              address={address}
              link={link}
              image={image}
              description={description}
              event_location_map={event_location_map}
            />
          </div>
            <dd className="flex items-center">
              {event_location_map && (
                <>
                  <a
                    href={event_location_map.link}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    <svg
                      width="24"
                      height="24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="mr-1 text-slate-400 dark:text-slate-500"
                      aria-hidden="true"
                    >
                      <path d="M18 11.034C18 14.897 12 19 12 19s-6-4.103-6-7.966C6 7.655 8.819 5 12 5s6 2.655 6 6.034Z" />
                      <path d="M14 11a2 2 0 1 1-4 0 2 2 0 0 1 4 0Z" />
                    </svg>
                    <p class="text-gray-500 font-medium md:block">
                      {address && <dd>{address.join(", ")}</dd>}
                    </p>
                  </a>
                  {date && <dd>{date.when}</dd>}
                </>
              )}
            </dd>
          <div class="flex justify-between item-center">
            <p class="text-gray-500 font-medium hidden md:block">Vacations</p>
